INSERT INTO `master_soal` VALUES (1,0,'AAYH',1,0,0,0,0,'    1. &amp;lt;b&amp;gt;Cara&amp;lt;/b&amp;gt; &amp;lt;i&amp;gt;penyusunan&amp;lt;/i&amp;gt; naskah dinas harus memperhitungkan segi keindahan, yaitu meliputi: ','pengaturan letak kalimat yang simetris, keserasian dan kerapian, dan ruang tepi dan jarak/spasi.','pengaturan kata per kata.','pengaturan naskah.','pengaturan kalimat satu ke kalimat berikutnya.',' '),(2,0,'AAYH',1,0,0,0,0,'    2. &amp;lt;font color=&amp;quot;Red&amp;quot;&amp;gt;Ketentuan &amp;lt;/font&amp;gt;&amp;lt;u&amp;gt;yang&amp;lt;/u&amp;gt; ditetapkan oleh Kepala Kepolisian yang berwenang dan memuat kebijakan yang bersifat mengatur dan mengikat secara umum adalah pengertian dari: ','peraturan.','keputusan.','instruksi.','jawaban A, B, dan C salah semua.',' '),(3,0,'AAYH',1,0,0,0,0,'    3. Salah satu ciri peraturan adalah: ','bersifat mengatur dan mengikat secara umum.','bersifat perintah.','bersifat penetapan.','bersifat arahan.',' '),(4,0,'AAYH',1,0,0,0,0,'    4. Peraturan Kapolri harus diundangkan dengan penempatan dalam &amp;amp;hellip; ','Berita Negara Republik Indonesia.','Berita Acara Negara Republik Indonesia.','Lembaran Negara Republik Indonesia.','Tata Usaha Negara Republik Indonesia.',' '),(5,0,'AAYH',1,0,0,0,0,'    5. Naskah dinas harus dilaksanakan secara tepat guna dan berdaya guna, salah satu faktor yang perlu diperhatikan  adalah ','keamanannya.','perintahnya.','sarannya.','aturan.',' '),(6,0,'AAYH',1,0,0,0,0,'    6. Naskah dinas di lingkungan Polri digunakan sebagai komunikasi untuk penyampaian, yaitu: ','jawaban A, B, dan C benar semua.','aturan.','keterangan.','ide.',' '),(7,0,'AAYH',1,0,0,0,0,'    7. Komunikasi ke atas, yaitu kegiatan bawahan untuk menyampaikan keterangan atau ide kepada pimpinan atau atansannya. Kegiatan tersebut dapat berupa:  ','saran, informasi dan laporan.','aturan dan perintah.','aturan dan saran.','perintah dan saran.',' '),(8,0,'AAYH',1,0,0,0,0,'    8. Komunikasi ke bawah, yaitu kegiatan pimpinan atau atasan  untuk penyampaian, yaitu: ','keterangan atau ide kepada bawahan.','saran, informasi dan laporan kepada bawahan.','aturan dan saran kepada bawahan.','perintah dan saran kepada bawahan.',' '),(9,0,'AAYH',1,0,0,0,0,'    9. Komunikasi mendatar, yaitu kegiatan antar pejabat untuk menyampaikan keterangan atau ide kepada pejabat, yaitu:  ','yang sederajat.','di atasnya.','di bawahnya.','jawaban A, B, dan C benar semua.',' '),(10,0,'AAYH',1,0,0,0,0,'    10. Komunikasi ke atas dapat berupa antara lain, kecuali:  ','pujian','saran.','informasi.','laporan.',' '),(11,0,'AAYH',1,0,0,0,0,'    11. Komunikasi ke bawah dapat berupa antara lain, kecuali: ','saran.','perintah.','teguran.','petunjuk',' '),(12,0,'AAYH',1,0,0,0,0,'    12. Komunikasi mendatar dilaksanakan dalam rangka melaksanakan, yaitu: ','koordinasi.','berkumunikasi.','berargumentasi.','berdiskusi.',' '),(13,0,'AAYH',1,0,0,0,0,'    13. Penyampaian naskah dinas di lingkungan Polri dilakukan secara, yaitu: ','vertikal dan horizontal.','biasa.','rahasia.','khusus.',' '),(14,0,'AAYH',1,0,0,0,0,'    14. Arus penyampaian naskah dinas dari atasan kepada bawahan atau bawahan kepada atasan secara timbal-balik, disebut penyampaian naskah dinas secara, yaitu: ','vertikal.','horizontal.','diagonal.','biasa',' '),(15,0,'AAYH',1,0,0,0,0,'    15. Arus penyampaian naskah dinas dari dan kepada pejabat setingkat secara timbal-balik, disebut penyampaian naskah dinas secara, yaitu: ','horizontal.','vertikal.','diagonal.','biasa',' '),(16,0,'AAYH',1,0,0,0,0,'    16. Apa yang dituangkan dalam naskah dinas mencakup apa yang dikehendaki dan dapat dimengerti dan tidak perlu panjang lebar serta menggunakan kalimat yang efektif artinya dalam pembuatan naskah dinas harus &amp;amp;hellip; ','singkat dan padat.','teliti.','jelas.','pembakuan.',' '),(17,0,'AAYH',1,0,0,0,0,'    17. Setiap naskah dinas apabila dibaca atau diperbanyak, isi surat tidak menimbulkan keragu-raguan dan tidak menimbulkan tafsiran lain artinya setiap naskah dinas h